import React from "react";
import RouterPage from "./comp/route/router";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Navbar from "./comp/navbar";
import Footer from "./comp/footer";
function App() {
  return (
    <div className="main">
      <Router>
        <Switch>
          <Route exact path="/">
            <Navbar />
            <App />
            <Footer />
          </Route>
        </Switch>
      </Router>
      ;
      <RouterPage />
    </div>
  );
}

export default App;
